import React from "react";

const UserReadingStats = ({ score }) => {
  let level = "";
  switch (score) {
    case score < 10:
      level = "beginner";
      break;
    case score > 10 && score < 17:
      level = "intermediate";
      break;
    case score > 17:
      level = "advanced";
      break;
    default:
      level = "unknown";
      break;
  }
  return <div>{level}</div>;
};

export default UserReadingStats;
